import Auth from "../../components/auth";
import Button from 'react-bootstrap/Button';

function Create() {
    return(
        <Auth>
            <link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/4.0.0-alpha.6/css/bootstrap.min.css" />
            <h1>Create Question Page</h1>
            <input placeholder="Question title"></input><br />
            <input placeholder="Correct answer"></input><br />
            <input placeholder="Other answer 1"></input><br />
            <input placeholder="Other answer 2"></input><br />
            <input placeholder="Other answer 3"></input><br />
            <Button>Submit</Button> <br />
        </Auth>
    )
}

export default Create
